Thanks to everyone that came out and vibe out with us! 

We had multiple generations of dancers jamming together under one roof for the first time in a long time getting down to great music, non stop cyphers, and a shared love of dance! 

Thank you to @district9.toronto for the awesome venue, we look forward to working together more in the future. 

Big shoutout to @djridley90s for coming through and dropping non stop fire all weekend. 

Shoutout to @aaronjharper for keeping the vibes going and keeping the party element alive.

This event was the first of many and we look forward to keeping the party element of our culture alive. 

Stay tuned!

